import React from "react";
import "./dropDown.css";
import { Link } from "react-router-dom";
const Dropdown = (props) => {

  return (
    <>
      <div className="shadow-sm d-flex col-1 dropDownList position-absolute">
        <ul className="flex flex-col align-items-baseline list-group">
          <li className="col-12 list-group-item list-group-item-action">
            Edit
          </li>
          <li className="text-start pt-2">Delete</li>
        </ul>
      </div>
    </>
  );
};

export default Dropdown;
